@
@ It seems we have a multi-conext (maybe even pre-emptive) scheduler here
@
@ OR[6] seems to point to the current execution context
@
@ Execution contexts are stringed up into a (single) linked list
@ Each context has the following layout:
@
@ offset  0: Context queue linked list - next or 0 if not part of any
@ offset  1: Context queue linked list - prev
@ offset  2: priority, at least in the lowest nibble
@ offset  3:
@ offset  4:
@ offset  5:
@ offset  6:
@ offset  7:
@ offset  8:
@ offset  9: bit-15: context active? bit-14: context inactivated?
@ offset 10: Last runtime manager function call number
@ offset 11: Head of queue of which this context is part of. 0 if waiting only
@ offset 12: Linked list for waiting queue at 0x0D1C - next - set to 0 if not part of list - set to 0 on entry to runtime manager
@ offset 13: Linked list for waiting queue at 0x0D1C - prev                                - set to 0 on entry to runtime manager
@ offset 14:                                                                               - set to 0 on entry to runtime manager
@ offset 15: Timeout parameter for waiting queue                                           - set to 0 on entry to runtime manager
@ offset 16: Active device descriptor
@
@ A context can be part of the 'ready-to-run' queue, managed with the head at 0x0CF3
@ It can also be waiting on an device interrupt for example, in which case it is part of the waiting list for the (EXB) device. This list is managed through descriptor offset 9 (head)
@ In parallel to this, a context can be part of the waiting list, which is linked separately in offset 12 and 13 and managed thourgh 0x0D1C. This queue is secondary as a context
@ can be waiting for an interrupt AND have a timeout (stored in offset 15) specified as well.
@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@

@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
