@@ Input: A: 0x2118 for example
@@        OR[3]
@@        OR[6]: context descriptor (?)
@@        OR[7]: pointer to some table?? at 0x6C11
@@        B: first OR register containing passed-in information
@@        OR[B]: Kernal call code
@@        OR[B+1]: first parameter for kernel call
@@        OR[B+n]: N-th parameter for kernel call
0x01B7 (0x00036E) 0x0400-       f:00002 d:   0 | I = 0                         
0x01B8 (0x000370) 0x0000-       f:00000 d:   0 | PASS                          
