0x01B9 (0x000372) 0x283B-       f:00024 d:  59 | OR[59] = A                    
@ Set some entries in the table pointed to by OR[7]:
@ ofs 6:  0
@ ofs 7:  B
@ ofs 8:  0
@ ofs 9:  E
@ ofs 10: Return Addrss - OR[3]
@ ofs 11: A (original, on invocation)
@ ofs 12 and on: OR register save area
0x01BA (0x000374) 0x2007-       f:00020 d:   7 | A = OR[7]                     
