@ Read some data from the tape drive and copy it to OR[152]
@ Inputs: OR[270] - some buffer whose address is sent to the tape device - on potential invocation, it points to 40 words after the end of the boot image
@         OR[152] - some buffer into which we potentially copy some words from OR[270] - this is the table location from above. By the time this gets called, it points to the end of the destination table
@ Sequence of expander (tape?) operations
@ fn005, value 18 (022) - device address (This seems to be a 'casette device', a type of tape device (see HR-0808 Part 3 7-31)
@ fn015, value OR[270]   - device data B
@ wait 'till not busy (or error if timeout)
@ fn016, value -2048     - device data C
@ wait 'till not busy (or error if timeout)
@ fn014, value 0         - device data A
@ wait 'till not busy (or error if timeout)
@ fn017, value 1         - send control (start function)
@ wait 'till not busy (or error if timeout)
@ fn004,                 - request busy/done flag and interrupt number
@ wait 'till not busy (or error if timeout)
@ fn011,                 - read status
@ Test to see if MSB is set, if not, wait some more - this is the DONE flag of the seleced device (device 18)
@ fn001,                 - request data from 'A' register
@ wait 'till not busy (or error if timeout)
@ fn010,                 - request data bus status (the requested 'A' register data)
@ Store it in OR[153]
@ Make sure MSB is not set (FATAL if it is)
@ fn002,                 - request data from 'B' register
@ wait 'till not busy (or error if timeout)
@ fn010,                 - request data bus status (the requested 'B' register data)
@ Store it at OR[59]
@ Make sure register 'B' is greater or equal as what we've sent out earlier - FATAL if not
@ If returned 'B' is the same as what we've sent, return immediately, otherwise copy the difference from original location (OR[270]) to OR[152] in a loop
@ In other words, it returned 'B' is 10 greater then original, copy 10 words from original location to the buffer pointed to by OR[152]
@ This BTW also means that 'B' (or OR[270]) is some sort of an address for this operation. And that seems to be the only input paramter to this function as well
